import React, { useEffect, useRef, useState } from 'react';
import { MapPin, Navigation, Search, Sparkles, X } from 'lucide-react';
import { SearchBarProps } from '../types';

const SearchBar: React.FC<SearchBarProps> = ({
  origin,
  destination,
  onOriginChange,
  onDestinationChange,
  onSearch,
  loading
}) => {
  const [originSuggestions, setOriginSuggestions] = useState<string[]>([]);
  const [destinationSuggestions, setDestinationSuggestions] = useState<string[]>([]);
  const [showOriginSuggestions, setShowOriginSuggestions] = useState(false);
  const [showDestinationSuggestions, setShowDestinationSuggestions] = useState(false);
  const [focusedField, setFocusedField] = useState<'origin' | 'destination' | null>(null);

  const originRef = useRef<HTMLInputElement>(null);
  const destinationRef = useRef<HTMLInputElement>(null);
  const originAutocompleteRef = useRef<google.maps.places.Autocomplete | null>(null);
  const destinationAutocompleteRef = useRef<google.maps.places.Autocomplete | null>(null);

  // Initialize Google Places Autocomplete
  useEffect(() => {
    if (typeof google !== 'undefined' && google.maps && google.maps.places) {
      // Initialize origin autocomplete
      if (originRef.current && !originAutocompleteRef.current) {
        originAutocompleteRef.current = new google.maps.places.Autocomplete(originRef.current, {
          types: ['geocode', 'establishment'],
          fields: ['formatted_address', 'name', 'geometry'],
          componentRestrictions: { country: 'us' } // You can change this to your preferred country
        });

        originAutocompleteRef.current.addListener('place_changed', () => {
          const place = originAutocompleteRef.current?.getPlace();
          if (place?.formatted_address) {
            onOriginChange(place.formatted_address);
            setShowOriginSuggestions(false);
          }
        });
      }

      // Initialize destination autocomplete
      if (destinationRef.current && !destinationAutocompleteRef.current) {
        destinationAutocompleteRef.current = new google.maps.places.Autocomplete(destinationRef.current, {
          types: ['geocode', 'establishment'],
          fields: ['formatted_address', 'name', 'geometry'],
          componentRestrictions: { country: 'us' } // You can change this to your preferred country
        });

        destinationAutocompleteRef.current.addListener('place_changed', () => {
          const place = destinationAutocompleteRef.current?.getPlace();
          if (place?.formatted_address) {
            onDestinationChange(place.formatted_address);
            setShowDestinationSuggestions(false);
          }
        });
      }
    }
  }, [onOriginChange, onDestinationChange]);

  // Handle manual suggestions (fallback)
  const handleOriginChange = (value: string) => {
    onOriginChange(value);
    if (value.length > 2) {
      // Simple fallback suggestions if Google Places isn't available
      const suggestions = [
        `${value}, New York, NY`,
        `${value}, Los Angeles, CA`,
        `${value}, Chicago, IL`,
        `${value}, Houston, TX`,
        `${value}, Phoenix, AZ`
      ];
      setOriginSuggestions(suggestions);
      setShowOriginSuggestions(true);
    } else {
      setShowOriginSuggestions(false);
    }
  };

  const handleDestinationChange = (value: string) => {
    onDestinationChange(value);
    if (value.length > 2) {
      // Simple fallback suggestions if Google Places isn't available
      const suggestions = [
        `${value}, New York, NY`,
        `${value}, Los Angeles, CA`,
        `${value}, Chicago, IL`,
        `${value}, Houston, TX`,
        `${value}, Phoenix, AZ`
      ];
      setDestinationSuggestions(suggestions);
      setShowDestinationSuggestions(true);
    } else {
      setShowDestinationSuggestions(false);
    }
  };

  const handleSuggestionClick = (suggestion: string, field: 'origin' | 'destination') => {
    if (field === 'origin') {
      onOriginChange(suggestion);
      setShowOriginSuggestions(false);
      originRef.current?.focus();
    } else {
      onDestinationChange(suggestion);
      setShowDestinationSuggestions(false);
      destinationRef.current?.focus();
    }
  };

  const clearField = (field: 'origin' | 'destination') => {
    if (field === 'origin') {
      onOriginChange('');
      setShowOriginSuggestions(false);
      originRef.current?.focus();
    } else {
      onDestinationChange('');
      setShowDestinationSuggestions(false);
      destinationRef.current?.focus();
    }
  };

  return (
    <div className="space-y-6">
      <div className="space-y-4">
        <div>
          <label className="block text-sm font-semibold text-gray-700 mb-3">
            Starting Point
          </label>
          <div className="relative group">
            <div className="absolute left-4 top-1/2 transform -translate-y-1/2">
              <MapPin className="h-5 w-5 text-primary-500 group-focus-within:text-primary-600 transition-colors" />
            </div>
            <input
              ref={originRef}
              type="text"
              value={origin}
              onChange={(e) => handleOriginChange(e.target.value)}
              onFocus={() => {
                setFocusedField('origin');
                if (origin.length > 2) setShowOriginSuggestions(true);
              }}
              onBlur={() => {
                setTimeout(() => setShowOriginSuggestions(false), 200);
                setFocusedField(null);
              }}
              placeholder="Enter your starting location"
              className="w-full pl-12 pr-10 py-4 border-2 border-gray-200 rounded-xl focus:ring-4 focus:ring-primary-100 focus:border-primary-500 bg-white/80 backdrop-blur-sm transition-all duration-200 text-gray-900 placeholder-gray-500 font-medium"
            />
            {origin && (
              <button
                onClick={() => clearField('origin')}
                className="absolute right-4 top-1/2 transform -translate-y-1/2 text-gray-400 hover:text-gray-600 transition-colors"
              >
                <X className="h-4 w-4" />
              </button>
            )}

            {/* Suggestions Dropdown */}
            {showOriginSuggestions && originSuggestions.length > 0 && (
              <div className="absolute top-full left-0 right-0 mt-1 bg-white rounded-xl shadow-lg border border-gray-200 z-50 max-h-48 overflow-y-auto">
                {originSuggestions.map((suggestion, index) => (
                  <button
                    key={index}
                    onClick={() => handleSuggestionClick(suggestion, 'origin')}
                    className="w-full px-4 py-3 text-left hover:bg-gray-50 transition-colors border-b border-gray-100 last:border-b-0"
                  >
                    <div className="flex items-center space-x-3">
                      <MapPin className="h-4 w-4 text-primary-500 flex-shrink-0" />
                      <span className="text-sm text-gray-900">{suggestion}</span>
                    </div>
                  </button>
                ))}
              </div>
            )}
          </div>
        </div>

        <div>
          <label className="block text-sm font-semibold text-gray-700 mb-3">
            Destination
          </label>
          <div className="relative group">
            <div className="absolute left-4 top-1/2 transform -translate-y-1/2">
              <Navigation className="h-5 w-5 text-primary-500 group-focus-within:text-primary-600 transition-colors" />
            </div>
            <input
              ref={destinationRef}
              type="text"
              value={destination}
              onChange={(e) => handleDestinationChange(e.target.value)}
              onFocus={() => {
                setFocusedField('destination');
                if (destination.length > 2) setShowDestinationSuggestions(true);
              }}
              onBlur={() => {
                setTimeout(() => setShowDestinationSuggestions(false), 200);
                setFocusedField(null);
              }}
              placeholder="Enter your destination"
              className="w-full pl-12 pr-10 py-4 border-2 border-gray-200 rounded-xl focus:ring-4 focus:ring-primary-100 focus:border-primary-500 bg-white/80 backdrop-blur-sm transition-all duration-200 text-gray-900 placeholder-gray-500 font-medium"
            />
            {destination && (
              <button
                onClick={() => clearField('destination')}
                className="absolute right-4 top-1/2 transform -translate-y-1/2 text-gray-400 hover:text-gray-600 transition-colors"
              >
                <X className="h-4 w-4" />
              </button>
            )}

            {/* Suggestions Dropdown */}
            {showDestinationSuggestions && destinationSuggestions.length > 0 && (
              <div className="absolute top-full left-0 right-0 mt-1 bg-white rounded-xl shadow-lg border border-gray-200 z-50 max-h-48 overflow-y-auto">
                {destinationSuggestions.map((suggestion, index) => (
                  <button
                    key={index}
                    onClick={() => handleSuggestionClick(suggestion, 'destination')}
                    className="w-full px-4 py-3 text-left hover:bg-gray-50 transition-colors border-b border-gray-100 last:border-b-0"
                  >
                    <div className="flex items-center space-x-3">
                      <Navigation className="h-4 w-4 text-primary-500 flex-shrink-0" />
                      <span className="text-sm text-gray-900">{suggestion}</span>
                    </div>
                  </button>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>

      <button
        onClick={onSearch}
        disabled={!origin || !destination || loading}
        className="w-full btn-primary disabled:bg-gray-300 disabled:cursor-not-allowed disabled:transform-none flex items-center justify-center space-x-3 text-lg font-semibold"
      >
        {loading ? (
          <>
            <div className="animate-spin rounded-full h-5 w-5 border-2 border-white border-t-transparent"></div>
            <span>Finding Routes...</span>
          </>
        ) : (
          <>
            <Search className="h-5 w-5" />
            <span>Find Photo-Worthy Routes</span>
            <Sparkles className="h-4 w-4" />
          </>
        )}
      </button>

      {origin && destination && !loading && (
        <div className="bg-gradient-to-r from-green-50 to-blue-50 border border-green-200 rounded-xl p-4">
          <div className="flex items-center space-x-2 text-green-800">
            <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></div>
            <span className="text-sm font-medium">Ready to discover photo-worthy routes!</span>
          </div>
        </div>
      )}
    </div>
  );
};

export default SearchBar;
